       height: 100vh; 
    }
`;

function Questions( ) {

    return (
        <Styles>
            <h2>Questions</h2>
            <ul>
                {questions.map((element) => {
                    return (
                        <li key={element._id}>
                            <NavLink to={`/questions/${element._id}`}>{element.question}</NavLink>
                        </li>
                    );
                })}
            </ul>
        </Styles>
    );
};

export default Questions;
